drop table if exists titles cascade;
create table titles(
    id int primary key, 
    title varchar(255), 
    release_year int, 
    rating float,
    votes int);

drop table if exists names cascade;
create table names(
    id int primary key, 
    name varchar(255), 
    birth_year int, 
    death_year int);

drop table if exists categories;
create table categories(
    title_id int, 
    category varchar(255), 
    primary key (title_id, category),
    foreign key (title_id) references titles(id));

drop table if exists directed;
create table directed(
    title_id int, 
    name_id int, 
    primary key (title_id, name_id),
    foreign key (title_id) references titles(id),
    foreign key (name_id) references names(id));

drop table if exists acted;
create table acted(
    title_id int, 
    name_id int, 
    role varchar(255), 
    primary key (title_id, name_id, role),
    foreign key (title_id) references titles(id),
    foreign key (name_id) references names(id));













